import React from 'react';
import { Grid, GridItem } from '@chakra-ui/react';

const Directory = ({ name, img }) => {
	return (
		<Grid
			h="200px"
			templateRows="repeat(2, 1fr)"
			templateColumns="repeat(5, 1fr)"
			gap={4}
		>
			<GridItem colSpan={4} bg="tomato" />
		</Grid>
	);
};
export default Directory;
